import React from 'react';
import {
  Box,
  Typography,
  Card,
  CardContent,
  CardActions,
  Button,
} from '@mui/material';
import {
  Assignment as TaskIcon,
  LibraryBooks as ResourceIcon,
  Group as TeamIcon,
  Work as ProjectIcon,
} from '@mui/icons-material';
import { useNavigate } from 'react-router-dom';
import { useLanguage } from '../../contexts/LanguageContext';

interface StatCardProps {
  title: string;
  value: string | number;
  description: string;
  link: string;
  icon: React.ReactNode;
  color: string;
}

const StatCard: React.FC<StatCardProps> = ({ title, value, description, link, icon, color }) => {
  const navigate = useNavigate();
  const { t } = useLanguage();

  return (
    <Card>
      <CardContent>
        <Box sx={{ display: 'flex', alignItems: 'center', gap: 1, mb: 2 }}>
          {icon}
          <Typography color="textSecondary" gutterBottom>
            {t(title)}
          </Typography>
        </Box>
        <Typography variant="h4" component="div" sx={{ color }}>
          {value}
        </Typography>
        <Typography variant="body2" color="textSecondary">
          {t(description)}
        </Typography>
      </CardContent>
      <CardActions>
        <Button size="small" onClick={() => navigate(link)}>
          {t('viewDetails')}
        </Button>
      </CardActions>
    </Card>
  );
};

const Dashboard: React.FC = () => {
  const { t } = useLanguage();

  const stats = [
    {
      title: 'totalTasks',
      value: 24,
      description: 'activeDevelopmentTasks',
      link: '/development-platform',
      icon: <TaskIcon sx={{ color: '#2196f3' }} />,
      color: '#2196f3',
    },
    {
      title: 'resources',
      value: 156,
      description: 'availableResources',
      link: '/resources',
      icon: <ResourceIcon sx={{ color: '#4caf50' }} />,
      color: '#4caf50',
    },
    {
      title: 'teamMembers',
      value: 12,
      description: 'activeTeamMembers',
      link: '/team',
      icon: <TeamIcon sx={{ color: '#ff9800' }} />,
      color: '#ff9800',
    },
    {
      title: 'projects',
      value: 8,
      description: 'ongoingProjects',
      link: '/projects',
      icon: <ProjectIcon sx={{ color: '#9c27b0' }} />,
      color: '#9c27b0',
    },
  ];

  return (
    <Box>
      <Typography variant="h4" component="h1" gutterBottom>
        {t('dashboard')}
      </Typography>
      <Box sx={{ display: 'grid', gridTemplateColumns: { xs: '1fr', sm: '1fr 1fr', md: '1fr 1fr 1fr 1fr' }, gap: 3 }}>
        {stats.map((stat) => (
          <Box key={stat.title}>
            <StatCard {...stat} />
          </Box>
        ))}
      </Box>
    </Box>
  );
};

export default Dashboard;
